import { TypeAnimation } from 'react-type-animation';

const TypedAnimation = () => {
  return (
    <div>
      <TypeAnimation
        sequence={[
          `Dcoumenting as a developer has never been so simple.\nTHROTTLE.AI`,
          1000,
          "",
        ]}
        speed={50}
        style={{ whiteSpace: 'pre-line', fontSize: '20px' }}
        repeat={Infinity}
      />
    </div>
  );
};

export default TypedAnimation;
